import SpotifyPlayer from 'react-spotify-web-playback';
import {useEffect, useState} from "react";

export default function Player({token}) {

  const [play, setPlay] = useState(false)

  return (
    /* @ts-ignore */
    <div>
      {token}
      <SpotifyPlayer
        token={token}
        showSaveIcon
        callback={state => {
          if (!state.isPlaying) setPlay(false)
        }}
        play={play}
        uris={[]}
      />
    </div>
  )
}
